MobileSiteMap.Script:
update sitemap {

    add folder "Surveys" {
      type = HubFolder
      isDefaultFavorite = True
      displayName = "Surveys"
      icon = "system://Clock"
      add item "SU3010PL" { displayName = "Surveys" }    
    }
      
    add item "SU301000" {
      displayName = "Survey Summary"
      visible = False
    }      
}

add screen SU301000 {
 add container "SurveyResponseSummary"
   {
      displayName ="Survey Response Summary"
      formActionsToExpand = 1   
      add field "SurveyID"   
      add field "Recipient"
      add field "CollectedDateMobile" 
       { 
         displayName = "Collected Date"
       }
     
      add field "CollectorStatus"
   
      add recordAction "Cancel" { behavior = Cancel }     
      add recordAction "Submit" 
      {
         displayName ="Submit Survey"
         icon = "system://PaperPlane"  
         syncLongOperation = true
         behavior = Record 
      }  
   }
    add container "Questions" {
    displayName = "View Questions"
    attributes = True       
    attachments {    }    
   } 
}

add screen SU3010PL {
  add container "Result" {
    fieldsToShow = 4
    listActionsToExpand = 1
    containerActionsToExpand = 1
    add field "SurveyName"
    add field "Recipient"
    add field "CollectedDate"
    add field "CollectorStatus"
    
    add containerAction "editDetail" {
      behavior = Open
      redirect = True
    }

  }
}
